import React from 'react';
import { TextInput } from '../../components/TextInput';
import SvgIcons from '../../components/svg';
import { SimpleButton } from '../../components/SimpleButton';
import { useNavigate } from 'react-router-dom';
import { Formik, Form } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';


export const SignUp = () => {
  const navigate = useNavigate();

  const validationSchema = Yup.object({
    name: Yup.string().required('Name is required'),
    email: Yup.string().email('Invalid email address').required('Email is required'),
    password: Yup.string().min(6, 'Password must be at least 6 characters').required('Password is required'),
  });


  const handleSubmit = async (values, { setSubmitting, setErrors }) => {
    try {
      const response = await axios.post('https://tmf-backend.onrender.com/users/signup', values);
      console.log('Signup successful:', response.data);
      navigate('/login');
    } catch (error) {
      console.error('Signup failed:', error);
      setErrors({ apiError: error.response?.data?.message || 'Signup failed' });
    } finally {
      setSubmitting(false);
    }
  };
  return (
    <div className='w-full flex justify-center'>
      <div className='w-[90%] md:w-[480px] border-[1px] border-black flex flex-col items-center mt-20'>
        <h2 className='text-[30px] md:text-[38px] font-bold font-poppins py-3'>
          TMF
        </h2>
        <h1 className='text-[40px] md:text-[48px] font-bold font-roboto '>
          Sign Up
        </h1>
        <p className='text-[14px] md:text-[18px]  font-roboto py-3'>
          Signup to Tallmanfilms
        </p>
        {({ values, errors, touched, handleChange, handleBlur, isSubmitting }) => (
          <Form className='w-full flex flex-col items-center'>
        <div className='w-[90%] md:w-[80%]'>
          <TextInput
             label='Name*'
             type='text'
             name='name'
             onChange={handleChange}
             onBlur={handleBlur}
             value={values.name}
             error={touched.name && errors.name}
          />
        </div>
        <div className='w-[90%] md:w-[80%]'>
        <TextInput
                  label='Email*'
                  type='text'
                  name='email'
                  onChange={handleChange}
                  onBlur={handleBlur}
                  value={values.email}
                  error={touched.email && errors.email}
                />
        </div>

        <div className='w-[90%] md:w-[80%] pb-5'>
        <TextInput
                  label='Password*'
                  type='password'
                  name='password'
                  onChange={handleChange}
                  onBlur={handleBlur}
                  value={values.password}
                  error={touched.password && errors.password}
                  icon={<SvgIcons.Eye />}
                />
        </div>

        {errors.apiError && (
                <div className='text-red-500'>{errors.apiError}</div>
              )}
              <div className='w-[90%] md:w-[80%]'>
                <SimpleButton
                  text='Sign Up'
                  style='dark'
                  type='submit'
                  disabled={isSubmitting}
                />
              </div>
        <div className='w-[90%] md:w-[80%]'>
          <SimpleButton
            text='Sign Up'
            style='dark'
            onClick={() => {
              console.log('clicked');
            }}
            disabled={false}
          />
        </div>
            </Form>
        )}
